import { createApp } from 'vue'
import App from './App.vue'
import vuetify from './plugins/vuetify'
import { loadFonts } from './plugins/webfontloader'

import { createRouter, createWebHistory } from 'vue-router';

loadFonts();

const router = createRouter({
    history: createWebHistory(),
    routes: [
        { path: "/", component: LogIn, meta: { title: 'Login - QT' } },
        { path: "/customer", component: CustomerComp, meta: { title: 'Login - QT' } },
        { path: "/customer/list", component: CustomerComp, meta: { title: 'Login - QT' }, children: [{ path: "", component: CustomerList, meta: { title: 'Login - QT' } }] },
        { path: "/customerlist", component: CustomerList, meta: { title: 'Login - QT' } },
        { path: "/addcustomer", component: AddCustomer },
        { path: "/customer/create", component: CustomerComp, meta: { title: 'Login - QT' }, children: [{ path: "", component: AddCustomer, meta: { title: 'Login - QT' } }] },
    ]
});

createApp(App).use(vuetify).use(router).mount('#app');
